import React, { useState, useEffect } from 'react';
import { OpenAI } from 'openai';
import axios from 'axios';
import { createRoot } from 'react-dom/client';

function App() {
  const [generatedQuestion, setGeneratedQuestion] = useState('');
  const [questionData, setQuestionData] = useState({
    soru: '',
    dogru_cevap: '',
    yanlis_cevap1: '',
    yanlis_cevap2: '',
    yanlis_cevap3: '',
    tur: '',
    zorluk_seviyesi: '',
  });

  const apiKey = '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';

  const api = new OpenAI({
    apiKey,
    dangerouslyAllowBrowser: true,
  });

  const createAndSendQuestion = async () => {
    const soru =
      'Bana sadece 1 adet soru üret. sorunun konuları tarih, coğrafya, bilim, mantık matematik ve futbol ile alakalı olsun.soruları olabildiğince zor sor. temel sorular olmasın.zorluk seviyesini belirtirken bilinirliğe göre 1 ila 5 arasında puanla bu şekilde yazmanı istiyorum senden soruyu iki düz çizgi arasına yaz  |Soru| |Doğru cevap| |Yanlış cevap 1|  |Yanlış cevap 2|  |Yanlış cevap 3| |Tür| |Zorluk seviyesi| örnek verecek olursam |Kösedağ savaşaı hangi iki devlet arasında olmuştur| | Anadolu SELÇUKLU-MOĞOL| |GAZNELİ-SELÇUKLU| |Azerbaycan -ermenistan| |nijerya-bangladeş|  |tARİH | |2|';

    try {
      const completion = await api.chat.completions.create({
        messages: [{ role: 'system', content: soru }, { role: 'user', content: '' }],
        model: 'gpt-3.5-turbo'
      });

      const aiResponse = completion.choices[0].message.content;
      console.log(`AI: ${aiResponse}`);
      const veriler = aiResponse.split('|');

      const a = veriler[1];
      const dogru_cevap = veriler[3];
      const yanlis_cevap_1 = veriler[5];
      const yanlis_cevap_2 = veriler[7];
      const yanlis_cevap_3 = veriler[9];
      const tur = veriler[11];
      const zorlukSeviyesi = veriler[13];

      setQuestionData({
        soru: a,
        dogru_cevap,
        yanlis_cevap1,
        yanlis_cevap2,
        yanlis_cevap3,
        tur,
        zorluk_seviyesi,
      });

      const formData = new FormData();

      formData.append('soru', a);
      formData.append('dogru_cevap', dogru_cevap);
      formData.append('yanlis_cevap1', yanlis_cevap_1);
      formData.append('yanlis_cevap2', yanlis_cevap_2);
      formData.append('yanlis_cevap3', yanlis_cevap_3);
      formData.append('tur', tur);
      formData.append('zorluk_seviyesi', zorlukSeviyesi);

      const response1 = await axios.post('http://localhost:5000/create_question', formData, {
        headers: {
          'Content-Type': 'application/json',
        },
      });

      console.log(response1.data);

      return aiResponse;
    } catch (error) {
      console.error('Hata oluştu:', error);
      return '';
    }
  };

  const handleNewQuestion = async () => {
    const generatedQuestion = await createAndSendQuestion();
    setGeneratedQuestion(generatedQuestion);
  };

  return (
    <div className="App">
      <h1>Soru Oluşturma Uygulaması</h1>
      <button onClick={handleNewQuestion}>Yeni Soru Oluştur</button>
      <div>
        <h2>Oluşturulan Soru:</h2>
        <p>{generatedQuestion}</p>
      </div>
      <div>
        <input
          type="text"
          placeholder="Soru"
          value={questionData.soru}
          onChange={(e) => setQuestionData({ ...questionData, soru: e.target.value })}
        />
        <input
          type="text"
          placeholder="Doğru Cevap"
          value={questionData.dogru_cevap}
          onChange={(e) => setQuestionData({ ...questionData, dogru_cevap: e.target.value })}
        />
        <input
          type="text"
          placeholder="Yanlış Cevap 1"
          value={questionData.yanlis_cevap1}
          onChange={(e) => setQuestionData({ ...questionData, yanlis_cevap1: e.target.value })}
        />
        <input
          type="text"
          placeholder="Yanlış Cevap 2"
          value={questionData.yanlis_cevap2}
          onChange={(e) => setQuestionData({ ...questionData, yanlis_cevap2: e.target.value })}
        />
        <input
          type="text"
          placeholder="Yanlış Cevap 3"
          value={questionData.yanlis_cevap3}
          onChange={(e) => setQuestionData({ ...questionData, yanlis_cevap3: e.target.value })}
        />
        <input
          type="text"
          placeholder="Tür"
          value={questionData.tur}
          onChange={(e) => setQuestionData({ ...questionData, tur: e.target.value })}
        />
        <input
          type="number"
          placeholder="Zorluk Seviyesi"
          value={questionData.zorluk_seviyesi}
          onChange={(e) => setQuestionData({ ...questionData, zorluk_seviyesi: e.target.value })}
        />
        <button onClick={handleAddQuestion}>Soruyu Ekle</button>
      </div>
    </div>
  );
}

const root = createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

export default App;
